import React, { Component } from 'react';
import Nav from 'react-bootstrap/Nav';
import FeaturedProjects from './featuredprojects';
import Button from 'react-bootstrap/Button';

var tabFlag = false;

class OtherProjects extends Component {
    state = { tabselect: "design" }
    render() {
        if(this.state.tabselect === "design"){
            return ( 
                <React.Fragment>
                    <Nav justify variant="tabs" defaultActiveKey="/home">
                        <Nav.Item>
                            <Nav.Link onSelect={() => this.tabselector("design")}>Design</Nav.Link>
                        </Nav.Item>
                        <Nav.Item>
                            <Nav.Link onSelect={() => this.tabselector("software")}>Software</Nav.Link>
                        </Nav.Item>
                        <Nav.Item>
                            <Nav.Link onSelect={() => this.tabselector("engineering")}>Engineering</Nav.Link>
                        </Nav.Item>
                    </Nav>
                    <FeaturedProjects></FeaturedProjects>
                </React.Fragment>
             );

        }
        else{
            return(
                <React.Fragment>
                    <Nav justify variant="tabs" defaultActiveKey="/home">
                        <Nav.Item>
                            <Nav.Link onSelect={() => this.tabselector("design")}>Design</Nav.Link>
                        </Nav.Item>
                        <Nav.Item>
                            <Nav.Link onSelect={() => this.tabselector("software")}>Software</Nav.Link>
                        </Nav.Item>
                        <Nav.Item>
                            <Nav.Link onSelect={() => this.tabselector("engineering")}>Engineering</Nav.Link>
                        </Nav.Item>
                    </Nav>
                    software or engineering
                </React.Fragment>
            );
        } 
        
    }


    tabselector = (tab) => {
        if(tab == "design"){
            this.setState({tabselect: tab});
        }
        else if(tab == "software"){
            this.setState({tabselect: tab});
        }
        else if(tab == "engineering"){
            this.setState({tabselect: tab});
        }

    }

}
 
export default OtherProjects;
